import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';

function Header() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid className="vw-99">
        <Navbar.Brand href="#">fukatkhau.com</Navbar.Brand>
        <Navbar.Toggle style={{ zIndex: "1000" }} />
        <Navbar.Collapse id="navbarScroll" className="justify-content-end">
          <div className='px-2 py-3'>
            <Nav
              className="px-2 pt-3 py-2 py-lg-0"
              style={{ maxHeight: '200px' }}
              navbarScroll
            >
              <NavLink to="/" className="nav-link">Home</NavLink>
              <NavLink to="/Components/About" className="nav-link">About</NavLink>
              <NavLink to="/Components/Contact" className="nav-link">Contact</NavLink>
            </Nav>
          </div>

          <div className='Searchform'>
            <Form className="d-flex my-3 mx-3 Searchform">
              <Form.Control
                name="query"
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success" className='searchbtn'>Search</Button>
            </Form>
          </div>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
